    <div className="login">
        <span className="loginTitle">Login</span>
        <form className="loginForm" onSubmit={(e)}>
            <label>Username : </label>
            <input 
                type="text" 
                placeholder="Enter your username here..." 
                value={username} 
                onChange={(e) => setUsername(e.target.value)}
            />
